  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains aggregated, non-PII
  data generated by FEMAu2019s Enterprise Coordination & Information Management (ECIM)
  Reporting team to share data on Registrations and Individuals and Households Program
  (IHP) where registration for disaster is valid. Segmented by zip-code additional
  core data elements include: valid call center registrations, valid web registrations,
  valid mobile registrations, IHP eligible, IHP amount, Housing Assistance (HA) referrals,
  HA eligible, HA amount, Other Needs Assistance (ONA) eligible, and ONA amount.\",\n\t\"license_title\":
